import './NavBar.scss';

const NavBar = () => {
  return (
      <nav className='nav'>
        <ul>
          <li>
            Home
          </li>
          <li>
            Info
          </li>
          <li>
            Process
          </li>
          <li>
            Contact
          </li>
        </ul>
      </nav>
  );
};

export default NavBar;
